Un shih-poo es un perro que nace fruto del cruce entre un shih tzu y un poodle o caniche. Se trata de un perro mestizo que ha ganado muchísima popularidad en los últimos años debido a su tierna apariencia y reducido tamaño. 

El shih-poo se caracteriza por ser una adorable bolita de pelo, que puede presumir de una estupenda salud. Todo ello hace que el shih-poo se haya convertido en tendencia en el mundo canino.

Como sucede con otras razas mestizas, el shih-poo no cuenta con un estándar oficial debido a que no constituye una raza reconocida por las organizaciones cinológicas internacionales. 
	
𝕊ℂℍℕ𝕆𝕆𝔻𝕃𝔼

El Schnoodle es un perro que surge del cruce entre el Schnauzer y el Poodle. No reconocido todavía como raza.

Son perros increíblemente amistosos, que no escatiman a la hora de demostrar su afecto hacia los que lo rodean. Son muy activos, por lo que les encanta jugar, saltar y correr a todas horas.

Son enormemente inteligentes, característica que heredan del poodle. Este rasgo combinado con su desarrollada curiosidad, los hace unos aprendices excelentes.

